import React from "react";
import { useNavigate } from "react-router-dom";

const Card = ({ location, image }) => {
  const navigate = useNavigate();
  return (
    <div class="card">
      <div class="card-image">
        <img
          onClick={() => navigate("/houseView")}
          style={{
            height: "100%",
            width: "100%",
          }}
          src={image}
          alt=""
        />
      </div>

      <div class="bathroom">
        <i class="fi fi-bs-bath"></i>
      </div>
      <div class="heading">{location}</div>
    </div>
  );
};

export default Card;
